import Header from './Components/Header';
import Sidebar from './Components/Sidebar';
import './App.css';
import BodyInnerContainer from './Components/BodyInnerContainer';

function App() {
  return (
    <div className="App">
      <Header />
      <div className='body_container'>
        <Sidebar />
        <BodyInnerContainer />
        <h2>Food</h2>
      </div>

    </div>
  );
}

export default App;
